/**
 * Embeds base64 logo data for dynamic import and HTML export.
 */
function getImageData(key) {
	switch(key) {
		case "BTC": return "data:image/png;base64,";
		case "ETH": return "data:image/png;base64,";
		case "XMR": return "data:image/png;base64,";
		case "BCH": return "data:image/png;base64,";
		case "DASH": return "data:image/png;base64,";
		case "LTC": return "data:image/png;base64,";
		case "OMG": return "data:image/png;base64,";
		case "ETC": return "data:image/png;base64,";
		case "ZEC": return "data:image/png;base64,";
		case "CRYPTOSTORAGE": return "data:image/png;base64,";
		case "QUESTION_MARK": return "data:image/png;base64,";
		default: throw new Error("Image data not found for key: " + key);
	}
}
